export const convertCalendar = str => {
  const close = { open: false };
  const days = [close, close, close, close, close, close, close];
  let idx = 0;

  for (let i = 0; i < str.length;) {
    const testClose = str[i] === '0';
    if (!testClose) {
      days[idx] = {
        open: true,
        openAt: timesObj[str[i]],
        closeAt: timesObj[str[i + 1]]
      };
    }
    idx += 1;
    i += testClose ? 1 : 2;
  }

  return days;
};

